	<script>
		var initialized = false;
		var detect_faces = false;
		var playing = false;
		var frameCount = 0;
		function button_callback() {
			/*
				(0) check whether we're already running face detection
			*/
			if(initialized)
				return; // if yes, then do not initialize everything again
			/*
				(1) prepare the pico.js face detector
			*/
			var update_memory = pico.instantiate_detection_memory(2); // we will use the detecions of the last 5 frames
			var facefinder_classify_region = function(r, c, s, pixels, ldim) {return -1.0;};
			facefinder_classify_region = pico.unpack_cascade();
			
			
			/*
				(2) get the drawing context on the canvas and define a function to transform an RGBA image to grayscale
			*/
			var ctx = document.getElementById('WebCamCanvas').getContext('2d');
			ctx.translate(ncols, 0);
			ctx.scale(-1, 1);
			function rgba_to_grayscale(rgba, nrows, ncols) {
				var gray = new Uint8Array(nrows*ncols);
				for(var r=0; r<nrows; ++r)
					for(var c=0; c<ncols; ++c){
						var pos = r*4*ncols+4*c;
						gray[r*ncols + c] = (2*rgba[pos]+7*rgba[pos+1]+rgba[pos+2])/10;
					}
				return gray;
			}
			/*
				(3) this function is called each time a video frame becomes available
			*/
			var processfn = function(video, dt) {
				if(playing){
				
					//ctx.drawImage(video, 0, 100,1280,320,0,0,960,240);
					ctx.drawImage(video, 0, 100, ncols, nrows, 0, 0, ncols, nrows);
					if(detect_faces){
						if(frameCount%(frameskip+1) == 0)
						{
							var rgba = ctx.getImageData(0, 0, ncols, nrows).data;
							// prepare input to `run_cascade`
							image = {
								"pixels": rgba_to_grayscale(rgba, nrows, ncols),
								"nrows": nrows,
								"ncols": ncols,
								"ldim": ncols
							}
							params = {
								"shiftfactor": 0.15, // move the detection window by 10% of its size
								"minsize": 27,     // minimum size of a face
								"maxsize": 1000,    // maximum size of a face
								"scalefactor": 1.1  // for multiscale processing: resize the detection window by 10% when moving to the higher scale
							}
							// run the cascade over the frame and cluster the obtained detections
							// dets is an array that contains (r, c, s, q) quadruplets
							// (representing row, column, scale and detection score)
							dets = pico.run_cascade(image, facefinder_classify_region, params);
							dets = update_memory(dets);
							dets = pico.cluster_detections(dets, 0.2); // set IoU threshold to 0.2
							// draw detections
							$('.mask').remove();
							for(i=0; i<dets.length; ++i){
								if(dets[i][3]>50.0)
								{	/*var x,y;
									y=(dets[i][0]-(dets[i][2]/2));
									x=(dets[i][1]-(dets[i][2]/2));
									ctx.beginPath();
									//ctx.arc(dets[i][1], dets[i][0], dets[i][2]/2, 0, 2*Math.PI, false);
									ctx.strokeRect(840-x-dets[i][2],y,dets[i][2],dets[i][2]);
									console.log("x-centro: "+x+"\ny-centro:"+y+"\nx-superiorizquierda:"+x+"\ny-superiorizquierda:"+y+"\nancho y alto: "+dets[i][2]);
									
									ctx.lineWidth = 3;
									ctx.strokeStyle = 'red';
									ctx.stroke();*/
									dibujar_mascara(dets[i][1]-(dets[i][2]/2), dets[i][0]-(dets[i][2]/2), dets[i][2]/2);
									//captura();
								}
							}
							frameCount=1;
						}else
						{
							frameCount++;
						}
					}
				}
			}
			/*
				(4) instantiate camera handling (see https://github.com/cbrandolino/camvas)
			*/
			var mycamvas = new camvas(ctx, processfn);
			/*
				(5) it seems that everything went well
			*/
			initialized = true;
		}
	
	</script>
	<script>
	//helpers
		function dibujar_mascara(center_X,center_Y,radious){
			center_X+(radious);
			center_Y+(radious);
			radious *= mask_scale;
			
			var face_rect = new Rectangle (center_X+(radious/mask_scale),center_Y+(radious/mask_scale),radious,radious);
			var img = $('<img class="mask">');
			img.attr('src', masks);
			img.attr('style', 'width:'+((face_rect.right - face_rect.left))+'px;height:'+(face_rect.bottom - face_rect.top)+'px;position:absolute;top:'+(face_rect.top)+'px;left:'+((face_rect.left))+'px;z-index:30;');
			FaceX=face_rect.left;
			FaceY=face_rect.top;
			FaceWidth=face_rect.right - face_rect.left;
			FaceHeight=face_rect.bottom - face_rect.top;
			
			img.appendTo('#detecciones');
		}
		
		function Rectangle (x, y, w, h) {
			this.x = x;
			this.y = y;
			this.width = w/2;
			this.height = h/2;
			this.left = x -  this.width;
			this.right = x + this.width;
			this.top = y - this.height;
			this.bottom = y + this.height;
		}
		function mainLogic(){
			button_callback();
			var requestAnimationFrame = window.requestAnimationFrame || window.mozRequestAnimationFrame ||
										window.webkitRequestAnimationFrame || window.msRequestAnimationFrame;
			window.requestAnimationFrame = requestAnimationFrame;
			
			if(!dev) eoapi.extInvoke("ready", [window.navigator.appVersion]);
			else play();
		}
		
		
		
	</script>
	
	
<script type="text/javascript" src="html2canvas.min.js"></script>
<meta name="viewport" content="width=device-width, initial-scale=1.0">
</head>
<body onload="mainLogic()" bgcolor="#000" style="overflow:hidden;">

	<div id="detecciones" style="overflow:hidden;width:100%;height:100%;position:absolute;top:0;left:0px;z-index:0">
		<canvas id="WebCamCanvas" width=840 height=840 ></canvas>
	</div>
	
	<video id="intro" src="dia_de_muertos.webm" style="position:absolute;top:0;left:0;width:100%;z-index:10;" ></video>
	<button style="position:relative;top:440px;left:200px;z-index:100;" onclick="captura();" >captura<button>
</body>

	<script>
	var video = document.getElementById("intro");
	function captura(){
		intro.play();
		html2canvas(document.querySelector("#detecciones")).then(canvas => {
		document.body.appendChild(canvas);
		
		var context = canvas.getContext('2d');
		context.drawImage(video, FaceX-10, FaceY-10, FaceWidth+20, FaceHeight+20);
		var dataURL = canvas.toDataURL();

		//create img
		var img = document.createElement('img');
		img.setAttribute('src', dataURL);

		//append img in container div
		document.body.appendChild(img);
		dataURL = canvas.toDataURL();
		var a = document.createElement('a');
		
		//DOWNLOAD IMG
		a.download = true;
		a.target = '_blank';
		a.href= dataURL;

		a.click();
		canvas.setAttribute('display', 'none');
		});
	}
	</script>
